script: |
  super -f text -I q3416.spq | sort > q3416.out

inputs:
  - name: q3416.spq
    data: |
      SELECT ALL 74 / col2 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT - col2 NOT BETWEEN + col1 / 31 + col2 AND col0 - + ( col1 + + col0 / - col1 );
  - name: tab0

outputs:
  - name: q3416.out
    data: |
